import React, {useHistory} from 'react'

export default function Main() {
    let history = useHistory();
    function onLogOut() {
        history.push("/");
    }

    return (
        <div>
            <h1>
                Main
            </h1>
            <button onClick={onLogOut}>
                logout
            </button>
        </div>
    )
}
